Lave as mãos com frequência de forma correta;
Use máscaras onde há aglomerado de pessoas vindo de outros países; embora não tenha tanta eficácia. 
Use álcool gel;
Afasta-se dos possíveis contaminados.
Sem pânico.
Ninguém vai virar zumbi, mas pode matar, então é só manter a higiene.
